    public static int[] SumPrefixScores(string[] words)
    {
        TrieNode root = new TrieNode();

        // Build the Trie and count prefix occurrences
        foreach (string word in words)
        {
            TrieNode node = root;
            foreach (char c in word)
            {
                if (!node.Children.ContainsKey(c))
                {
                    node.Children[c] = new TrieNode();
                }
                node = node.Children[c];
                node.Count += 1; // Increment the count for this prefix
            }
        }

        // Calculate the prefix score for each word
        int[] scores = new int[words.Length];
        for (int i = 0; i < words.Length; i++)
        {
            TrieNode node = root;
            foreach (char c in words[i])
            {
                node = node.Children[c];
                scores[i] += node.Count; // Sum the counts of the prefixes
            }
        }

        return scores;
    }
